window.bookSummaryJSON = "<p>The last thing a Necromancer expects is to be brought back from the dead....</p> <p>After fulfilling the duty all Arch Necromancers are tasked with, the last thing Sylver Sezari expected was to be reborn. He was usually the one reanimating dead things. How ironic.</p> <p>But reborn he was.</p> <p>And after crawling his way back into the land of the living, he finds himself a strange land, a strange time, and with a strange floating screen in front of his new face.</p> <p>Either through plan or chance, he’s alive again, and planning to enjoy himself to his heart's content.</p> <p>Don't miss the start of this LitRPG adventure about a reincarnated necromancer growing in power and finding his way in a new world where the rules have changed vastly since he last \"lived\".</p> <p>About the series: With equal parts humor and dark sorcery action, expect loads of skill progression, deep worldbuilding, and unforgettable characters in this story which had nearly 10 million views on Royal Road. Now completely revised and reedited for Kindle and Audible.</p>"; 
